            this._date = Date(date as String)
        } else if (UTSAndroid.`typeof`(date) == "number") {
            this._date = Date(date as Number)
        } else if (date is Date) {
            this._date = Date((date as Date).getTime())
        } else {
            this._date = Date()
        }
    }
